	["so_sand"] = { name = "Kumul", desc = "Kumul renk düzeninde koyu renklerle boyanmış bireysel parçalara sahiptir.\n\nTurner'ın ölümüyle birlikte artık yeni bir önceliğimiz var: Alex Kincaide'i kurtarmak - Felix Riley, Birlik Komutanı" },
	["so_stormfront"] = { name = "Fırtına", desc = "Tayfun renk temasından renkler kullanılarak katı renkler ile bazı parçaları sprey boya ile boyanmıştır.\n\nMonorayda seni bekliyor olacak" },
