	["am_dragon_glock"] = { name = "Ejderha Dövmesi", desc = "Metalik alt taban üstüne ejder motifi kullanılarak boyanmıştır.\n\nBir peri masalında her zaman şövalye ejderhayı öldürür... ama bu gerçek dünya - Valeria Jenner, Revolutionary" },
	["am_caustics"] = { name = "Yakıcılar", desc = "Kömür renkli metallik ana tabanın üstüne kırmızı ve beyaz bir hidrografi kullanılarak boyanmıştır." },
