	["aq_forced"] = { name = "Lekeli", desc = "Yüzeyine limon ve hardal damlatarak metal yüzey küflendirilmiştir.\n\nEğer bunun dağınık olduğunu düşünüyorsan, siyah ışık altında görene kadar bekle" },
	["aq_oiled"] = { name = "Sertleştirilmiş Kasa", desc = "Çok yüksek sıcaklıklarda odun kömürü kullanılarak ürünün yüzeyi sertleştirildiğinden dolayı bu rengi almıştır.\n\nBiraz renk kimseye zarar vermez" },
	["sp_spitfire_famas"] = { name = "Ateş Püsküren", desc = "sp_spitfire_famas" },
	["am_zebra"] = { name = "Katliam", desc = "Bu silah çeşitli alüminyum ve krom boyalarla zebra deseni şeklinde boyandı ve ardından domates kırmızısı renkli kaplama ile kaplandı.\n\nValeria Javier'e soru sormak için para ödemiyor... ondan cevapları bulup çıkarmak için ödüyor" },
	["am_zebra_dark"] = { name = "Kara Su", desc = "Krom boya katının üstüne kömür renkli, çeşitli yansımaların metalik resimleri, akuatik çizgiler halinde boyanmıştır.\n\nSu yaşam verir, ama alabilir de..." },
	["aa_vertigo"] = { name = "Hipnotik", desc = "İnci renkli ana boya katmanının üstüne siyah renk spreyle, grafik deseni ise el ile boyanmıştır.\n\nUykun gelmiyor, kan kaybından bayılıyorsun	" },
	["cu_spring_nova"] = { name = "Çiçekli Dal", desc = "Kiraz çiçeği motifine göre el ile boyanmış, daha sonra parlak bir kaplama verilmiştir." },
	["sp_hazard"] = { name = "Tehlike", desc = "sp_hazard" },
	["aq_rust"] = { name = "Paslı", desc = "Dış yüzeyleri paslanmış olmasına rağmen, bu silah hala mükemmel şekilde kullanılabilir." },
	["am_slither_p90"] = { name = "Soğukkanlı", desc = "Krom boya hattının üzerine andonize kırmızı boya efekti ile kaplanmıştır. Daha sonra sürünen yılan motifi lazer ile silaha işlenmiştir." },
	["am_carbon_fiber"] = { name = "Karbon Fiber", desc = "Grafit baz kat üzerine karbon fiber hidrografik kullanılarak boyanmıştır.\n\nTakımımı taşımış olmam, bunun takım işi olmadığını göstermez - Rona Sabri, Yükselen Yıldız" },
	["am_scorpion_p2000"] = { name = "Akrep", desc = "Kabzadaki sönük izler taşıyan kırmızı akrep çıkartması pürüzlü sönme desenli andonize efektli boyalar kullanılarak boyanmıştır." },
	["hy_feathers_aug"] = { name = "Kanatlar", desc = "Kartal tüyleri deseninin el ile yapıştırılmasıyla dekore edilmiştir.\n\nBir kartal gözünü oyana kadar görkemli görünür" },
	["sp_palm"] = { name = "Palmiye", desc = "Mukavva parçaları, sağlam ağlar ve palmiye yapraklarının kalıp olarak kullanılmasıyla sprey boya ile boyanmıştır." },
