	["cu_pinstripe_ak47"] = { name = "Zümrüt Çizgili", desc = "Bu silah, bataklık meşesi ile kaplanmış, beyaz ve yeşil çizgilerle boyanmıştır.\n\nImogen'i sorgulamak beni sorgulamaktır. Şimdi rahatla, bir içki al ve iş konuşalım. - Baba ve Anka Bölüm 2" },
