	["am_thorny_rose_mp9"] = { name = "Demir Gül", desc = "Gül ve diken motiflerinin farklı renkleri ile metalik boyalar kullanılarak el ile boyanmıştır.\n\nDikkat et, çok fazla dikeni var" },
