	["am_metals"] = { name = "Şövalye", desc = "Rönesans zırh temasına sahip pirinç hatlara sahiptir..\n\nCocinero ve Izaki'yi bulamıyorum derken neyi kastediyorsun? - Felix Riley, Birlik Komutanı" },
	["am_chainmail"] = { name = "Zincir Zırh", desc = "Gümüş boya katmanının üstüne yarı saydam zincir zırh hidrografisi ile boyanmıştır.\n\nAnka'da ki bütün üyeler arasından hiç kimse, Valeria'ya onun koruması Naomi kadar sadık değil" },
	["aq_handcannon"] = { name = "El Topu", desc = "Antika pirinç toplardan ilham alınarak, pirinç parçaları asit ile eskitilmiştir.\n\nGelecek denemelerde pek çok diken ile karşılaşacağına hazırlıklı ol" },
