	["hy_vines"] = { name = "Funda", desc = "Çiçekler ve kıvrılmış sarmaşıklar hidrografisi kullanılarak boyanmıştır.\n\nGerçek Aşkın Öpücüğü seni onun dikenlerinden korumaz" },
	["so_indigo"] = { name = "Kraliyet Mavisi", desc = "Çivit, kızıl ve gri renkleri ile katı bir şekilde boyanmıştır.\n\nGülümsemelisin Felix, inatçı bir alçak gibi gözükmesen, kadınlarla aran çok daha iyi olabilirdi - Imogen, Eğitimdeki Silah Satıcısı" },
	["so_indigo_and_grey"] = { name = "Çivit", desc = "Çivit, mavi ve gri renkleri ile katı bir şekilde boyanmıştır.\n\nAlex Kincaide, eminim kafanda çok fazla soru vardır... lütfen sana cevapları vermeme izin ver - Anka ve Hikayeci Bölüm 1" },
	["cu_well_traveled_ak47"] = { name = "Zengin Sınıfı", desc = "Kabzası kahverengi deri ile kaplanmış. Bu silah pek çok şehir görmüştür. \n\nDikkat eden herkes noktaları birleştirip onun ne yaptığını görebilir. Bir çözüm bulmak için fazla zamanımız yok... - Bir Babanın Sevgisi Bölüm 1" },
