	["cu_luggage_p2000"] = { name = "Ekonomi Sınıfı", desc = "Ekose hidrografisi ile boyanmıştır ve kabzası kahverengi deri ile kaplanmıştır.\n\nPek şık değil, ama seni istediğin yere götürür" },
	["aq_pilot_deagle"] = { name = "Pilot", desc = "Pirinç pilot kanat döşemesine sahiptir.\n\nÇarpışma pozisyonlarını varsay" },
	["cu_leather_xm1014"] = { name = "Kırmızı Deri", desc = "Kırmızı deri ile sapı ve kabzası sarılmıştır.\n\nÇantalarını topla. Hadi şu orospu çocuğunu öldürelim... - Oni ve Valkür Bölüm 2" },
	["cu_luggage_sg553"] = { name = "Yolcu", desc = "Bazı parçaları kahverengi deri ile kaplanmış ve klasik bagajlardan ilham alınarak özel olarak boyanmıştır.\n\nHerkesin bir hikayesi vardır ve Javier seni öldürmeden önce onu ortaya çıkartacaktır" },
	["cu_luggage_usp-s"] = { name = "Ticari Sınıf", desc = "Klasik bagaj renklerinden ilham alarak özel olarak boyanmıştır, bazı parçalarda koyu ten deriyle sarılmıştır.\n\nBazı insanlar sadece fazladan bacak alanı istemezler, onlar huzur ve sessizlik isterler" },
	["hy_plaid1"] = { name = "Zeytin Ekose", desc = "Bej ve ekose zeytin deseninin hidrografisi kullanılarak boyanmıştır.\n\nOnu sevdim. Kamerada gözlerimi ortaya çıkarıyor... - Rona Sabri, Yükselen Yıldız" },
