	["so_grey_nuclear_orange_five_seven"] = { name = "Sıcak Atış", desc = "Açık gri ve sıcak yeşil renkleriyle tek renk olarak boyanmıştır." },
	["cu_cerbrus_galil"] = { name = "Kerberos", desc = "Cerberus, yer altını koruyan üç kafalı mistik köpek, tasviri ile boyanmıştır." },
	["cu_tribute_ak47"] = { name = "Çöl İsyancısı", desc = "Grafiti ile kalıpla basılmış ve boyanmıştır.\n\nBir gün neden savaştığımızı soracaklar ve sordukları zaman anlayacaklar - Naomi, Valeria Jenner'ın Koruması" },
	["aq_glock_coiled"] = { name = "Öğütücü", desc = "Metal sürgüsü, yağlı boya kullanılarak boya şablon kombinasyonlarıyla birlikte el ile boyanmıştır.\n\nElmas yapmanın tek yolu baskı uygulamaktır	" },
	["am_g3sg1_murky"] = { name = "Kasvetli", desc = "Eloksallandıktan sonra leopar desenli hidrografi ile boyanmıştır.\n\nGidebileceğin daha karanlık bir yer her zaman vardır" },
	["aq_m4a1s_basilisk"] = { name = "Basilisk", desc = "Basilisk deseni ile dağlanmıştır.\n\nBakmak ayıptır fakat savaş şaka yapılacak bir zaman değildir" },
	["cu_m4a4_griffin"] = { name = "Griffin", desc = "Bir grifin resmi, el ile boyanmıştır.\n\nFelix takımını tüm dünyadaki çalışanlardan itinayla seçti... insanlar onların kişiliklerini sorgularken, onlar asla sonuçları sorgulamadı" },
	["sp_mag7_firebitten"] = { name = "Kundakçı", desc = "Katmanlar halinde sprey boya ile boyanmış, daha sonra yanan köşe görüntüsü vermek için damgalanmıştır.\n\nHer zaman küçük bir kıvılcımla başlar	" },
	["cu_mp9_chevron"] = { name = "Ok", desc = "Şeritli bir desen kullanılarak çizgili bir hidrografi kullanılarak boyanmıştır.\n\nYeteri kadar karşı sahaya attığın zaman eninde sonunda tam on ikiden vurursun" },
	["aq_p250_cartel"] = { name = "Kartel", desc = "İskelet, çiçek ve yılan desenleri oyularak süslenmiştir.\n\nTetiğe bir küçük darbe her sabahı Ölülerin Günü'ne döndürür" },
	["cu_p2000_fire_elemental"] = { name = "Ateş Elementali", desc = "Ateşten bir yaratık görüntüsünün grafik stiliyle özel olarak boyanmıştır.\n\nBazen ateşle oynamak iyi bir şeydir" },
	["aq_sawedoff_blackgold"] = { name = "Eşkıya", desc = "İskoç devedikeni motifinin siyah ve altın renkleri kullanılarak verniklenmiştir.\n\nTetiği çekerken serçe parmağını açık tutmak zorunda değilsin, fakat ince bir dokunuş" },
	["cu_scar20_intervention"] = { name = "Kardiyak", desc = "Modern turuncu ve mavi tasarımın ilk olarak boyanıp daha sonra ısıtılarak boyanmıştır.\n\nbip. bip. biiiiiip..." },
	["sp_ump45_d-visions"] = { name = "Yanılgı", desc = "Bir notilus tasarımı ile basılmıştır.\n\nCarcosa çağırıyor" },
	["cu_xm1014_caritas"] = { name = "Sükûnet", desc = "Uzun saçlı bir kadın imajı kullanılarak el ile boyanmıştır.\n\nİhtiyacım olan şey için burada değilim, istediğim şey için buradayım. - Imogen ve Oni Bölüm 2" },
	["am_awp_glory"] = { name = "Man-o'-war", desc = "Mavi metalik boya katmanının üstüne elle boyanmış metallik altın girdap ve vurgu desenleriyle boyanmıştır.\n\nBirkaç kafayı uçurmadan önce onların başını döndür" },
	["cu_elites_urbanstorm"] = { name = "Şehir Şoku", desc = "Şehir içi kamuflajı ve mavi vurgular ile özel olarak boyanmıştır.\n\nYıldırımın ardından her zaman gök gürültüsü gelir" },
	["aq_deagle_naga"] = { name = "Naga", desc = "Mitolojik bir motif ile işlenmiştir.\n\nBir Hint mitolojisinin yanı sıra savaş alanının da canavarı" },
	["cu_galil_abrasion"] = { name = "Geveze", desc = "El ile boyanmış ve basılmıştır. Toz korumasına boyanmış kuru kafa, ateş edildiğinde sürgünün hareket etmesiyle konuşuyormuş gibi görünür.\n\nBazıları sen gülerken dünyanında güldüğünü söyler... fakat Geveze güldüğünde etrafta sadece çığlıklar olur" },
	["cu_glock_deathtoll"] = { name = "Yeraltı Mezarlığı", desc = "Gümüş metalik boya katmanının üstüne kuru kafa hidrografisi kullanılarak boyanmıştır.\n\nTaklit en samimi yalakalıktır" },
	["cu_m4a4_ancestral"] = { name = "龍王 (Ejderha Kral)", desc = "Kırmızı ve mavi bir ejderhanın resmi ile özel olarak boyanmıştır.\n\nMaymun Kralın kendisine şayan bir silah - Booth, Silah Satıcısı" },
	["cu_m249_sektor"] = { name = "Sistem Kilidi", desc = "Bilim kurgu tasarımı ile özel olarak boyanmıştır.\n\nKoruma ateşi hiç bu kadar güzel görünmemişti" },
	["am_mac10_malachite"] = { name = "Bakır Taşı", desc = "Lastik tarak aletiyle dalgalı bir tasarım ve metallik efekt renkleri kullanılarak boyanmıştır.\n\nParlak renkler bu silahı karanlık bir amaç uğruna saklıyor" },
	["cu_mp9_deadly_poison"] = { name = "Ölümcül Zehir", desc = "Dinamik, açılı şekiller ve stilize edilmiş bir örümcek figürü ile özel olarak boyanmıştır.\n\nSeni öldüren o ilk ısırığı değil, ondan sonra gelen 29 tanesi" },
	["cu_p250_mandala"] = { name = "Ölüler Günü", desc = "Dairesel motifler kullanılarak özel olarak boyanmıştır.\n\nBu silah gelenek ve kan ile demlendi" },
	["cu_sawedoff_deva"] = { name = "Huzur", desc = "Kanatlı bir kadın resmi kullanılarak el ile boyanmıştır.\n\nHuzur herkesin sahip olamadığı bir lükstür - Valeria Jenner, Devrimci" },
	["aq_scar20_leak"] = { name = "Mağara", desc = "Mavi metalik efekt renkleri fırça ile boyanmış ve süngerlenmiştir.\n\nSeason Kuruluşunun kurucusu, ünlü Çalışan Kotaro Izaki tarafından kurtarıldıktan sonra bu parçayı emekliye ayırdı" },
	["aq_xm1014_sigla"] = { name = "Cıva", desc = "Metalik gümüş boyanın üstüne, motif halde yarı saydam arazi haritası hidrografisi ile boyanmıştır.\n\nBazen sorunlarınızı çözmeniz için tek ihtiyacınız olan şey dengesiz bir elementtir - Kotaro Izaki, Patlayıcı Uzmanı" },
	["an_tiger_orange"] = { name = "Kaplan Dişi", desc = "Kaplan çizgi deseninin el ile oyulmasıyla turuncu renkte andonize edilmiştir.\n\nKaplan gibi nadir... Kaplan gibi ölümcül..." },
	["am_marble_fade"] = { name = "Solgun Mermer", desc = "Siyah ve gümüşi metalik boya ile boyanıp, daha sonra üç renge boyanmıştır.\n\nBıçak birçok renkten yapılmıştır, ama yakında sadece kırmızı görünecek" },
	["am_marbleized"] = { name = "Doppler", desc = "Mermerleştirilmiş bir ortam kullanılarak siyah ve gümüş metalik boyalarla boyanmış, şeker ile kaplanmıştır.\n\nRenginin etkisinde kalmak ölümcül olabilir" },
	["cu_ak47_mastery"] = { name = "Elite Build", desc = "It has been custom painted using a combination of hydrographics and careful stenciling and detailed with heat-transfer decals.\n\nTread softly Naomi...people in your line of work aren't known for their longevity - The Shield and The Serpent Part 2" },
	["aq_mp7_ultramodern"] = { name = "Zırh Çekirdeği", desc = "Siyah yağ bazlı boya ile boyanmış ve fırçalanmış paslanmaz çelik parçalar ve çerçeve verilmiştir.\n\nAteş gücünün yanı sıra ince işçiliğe de değer veren bir Çalışan için kusursuz - Booth, Silah Satıcısı" },
	["aq_awp_twine"] = { name = "Solucan Tanrısı", desc = "Dayanıklı enamel boyaları kullanılarak bir kuru kafa ve kök resimleri ile boyanmıştır.\n\nTutunmak istemeyeceğin bazı kökler vardır" },
	["am_bronze_sparkle"] = { name = "Bronz Deko", desc = "Art deko kalıbında metalik otomotiv boyaları kullanılarak boyanmıştır.\n\nHerkes gümüş ve altın arayışında" },
	["aq_p250_contour"] = { name = "Valans", desc = "Silahın biçimini tamamlayıcı, modern bir mavi ve gri tasarım kullanılarak özel olarak boyanmştır.\n\nYeteneklerin sorguda değil, davranışın sorguda - Öğretmen ve Put Kırıcı Bölüm 1" },
	["cu_fiveseven_banana"] = { name = "Maymun İşi", desc = "Bu biz muz.\n\nBazen yiyeceklerinle oynamak sorun teşkil etmez" },
	["cu_galil_eco"] = { name = "Eko", desc = "Isı aktaran boyalar ile detaylandırılmış, beyaz ve yeşil renklerle boyanmıştır.\n\nYeterli miktarda parayla, Seçkin Tayfa her davayı kendilerininmiş gibi görür" },
	["aq_famas_jinn"] = { name = "Cin", desc = "Bir cin resmiyle kazınmış ve altın ile nikel kaplanmıştır.\n\nDilediğin şeyler hakkında dikkatli ol" },
	["cu_m4a1_hyper_beast"] = { name = "Hyper Beast", desc = "It has been custom painted with a beastly creature in psychadelic colours.\n\nYou really want to impress me Booth? Make this black light sensitive - Rona Sabri, Rising Star" },
	["cu_mag7_redhot"] = { name = "PaintKit_cu_mac10_redhot_tag", desc = "PaintKit_cu_mac10_redhot" },
	["am_negev_glory"] = { name = "PaintKit_am_awp_glory_Tag", desc = "PaintKit_am_awp_glory" },
	["cu_mac10_neonrider"] = { name = "Neon Sürücü", desc = "Ölümcül bir motorcunun resmi ile özel olarak boyanmıştır.\n\nBir kısım silah, iki kısım Klasör" },
	["cu_sawedoff_origami"] = { name = "Origami", desc = "Origamiden ilham alınarak tasarlanıp özel olarak boyanmıştır.\n\nGüzel bir şeyi yapmak zaman alır, fakat onu yok etmek sadece bir an alır" },
	["cu_cz75_precision"] = { name = "Pol Pozisyon", desc = "Kırmızı ve gri yarış teması ile özel olarak boyanmıştır.\n\nSadece bir şansımız var, bunu doğru yapalım - Felix Riley, Birlik Komutanı" },
	["am_ump_racer"] = { name = "Grand Prix", desc = "Eski moda bir yarış motifi ile özel olarak boyanmıştır.\n\nKaskını giymeyi unutma" },
	["am_aqua_flecks"] = { name = "Alacakaranlık Galaksi", desc = "am_aqua_flecks" },
	["cu_chronos_g3sg1"] = { name = "Kronos", desc = "Isı geçişi yapabilen yapıştırmalar ile vurgulanmış ve saykodelik renkli saat mekanizması hidrografisi ile dekore edilmiştir.\n\nZamanla, her şey mümkündür" },
	["hy_hades"] = { name = "Ölüler Diyarı", desc = "Antik Yunan miğferleri hidrografisi ile boyanmıştır.\n\nEğer benimle bir röportaj yapmak isteseydi, röportajı ayarlamanın daha kolay yolları olabilirdi - Kalkan ve Masalcı Bölüm 2" },
	["hy_icarus"] = { name = "İkarus Düştü", desc = "Bir güneş motifinin etrafında erimiş mum ve tüy hidrografisi ile boyanmıştır.\n\nTurner'ın ihaneti benim suçumdu... Bunu doğru yapmalıyım - Sebastien Hennequet, Keskin Nişancı" },
	["cu_labyrinth"] = { name = "Minotor'un Labirenti", desc = "İzometrik bir labirent hidrografisi ile boyanmıştır.\n\nBenden kaçış yok" },
	["sp_labyrinth1"] = { name = "Asteryon", desc = "İzometrik bir labirent kalıbı kullanılarak sprey boya ile boyanmıştır.\n\nKrallar sadece insan... ve hiçbir insan tapılmamalı - Valeria Jenner, İhtilalci" },
	["sp_labyrinth2"] = { name = "Kâşif", desc = "İzometrik bir labirent kalıbı kullanılarak sprey boya ile boyanmıştır.\n\nKişisel olarak 4. sürümü tercih ederim, fakat müşteri her zaman haklıdır - Booth, Silah Satıcısı" },
	["sp_labyrinth3"] = { name = "Daidalus", desc = "İzometrik bir labirent kalıbı kullanılarak sprey boya ile boyanmıştır.\n\nImogen... Eğer yaptığın şeyi öğrenirlerse, bu bize her şeye mal olacak - Bir Aile Sorunu Bölüm 1" },
	["cu_medusa_awp"] = { name = "Medusa", desc = "Bir gorgon resmi ile özel olarak boyanmıştır.\n\nEğer beni gördüysen zaten ölüsün" },
	["gs_mother_of_pearl_elite"] = { name = "Düellocu", desc = "Kabzası karanlık bir küflendirmeye sahip ve sedef ile boyanmıştır.\n\nSakız içermez" },
	["aa_pandora"] = { name = "Pandora'nın Kutusu", desc = "Karikatür ruhlar ile hava fırçasıyla boyanmıştır.\n\nDünya ateşler içinde, ama bizim en azından umudumuz var" },
	["cu_poseidon"] = { name = "Poseydon", desc = "Poseydon ve balıklar arasındaki savaşı betimleyen bir resim ile özel olarak boyanmıştır.\n\nEğer ikisi de ölüyse bir sır saklayabilirler" },
	["hy_zodiac1"] = { name = "Terazi'deki Ay", desc = "Bir zodyak motifi hidrografisi ile boyanmıştır.\n\nBugün aşk serüveni yakalamak ve rakiplerini öldürmek için harika bir gün" },
	["hy_zodiac2"] = { name = "Aslan'daki Güneş", desc = "Bir zodyak motifi hidrografisi ile boyanmıştır.\n\nDüşmanların için zor bir ay geçecek gibi" },
	["hy_zodiac3"] = { name = "Deniz Havası Tahmini", desc = "Bir zodyak motifi hidrografisi ile boyanmıştır.\n\nGeleceğin ne getireceğini kim bilebilir" },
	["so_khaki_green"] = { name = "Asker Yeşili", desc = "Haki yeşili ve siyah renk şemasından sert renkler ile sprey boya ile boyanmış bireysel parçalara sahiptir.\n\nDeğişmeyen kişi kendisi olur. Endişelenme Felix... onu durduracağım - Şövalye ve Öğretmen Bölüm 2" },
	["cu_anime_aug"] = { name = "Akihabara Benimsemesi", desc = "Anime ile süslenmiş cephane kaplamasına ısı geçişi yapabilen yapıştırma ile dekore edilmiştir.\n\nYatta!" },
	["am_bamboo_jungle"] = { name = "Hidroponik", desc = "Metalik boyalar kullanılarak bambu motif ile boyanmıştır.\n\nSilah Ustası Yukako'nun kendi yeşil temasını vurgulamak için AK-47'nin tahtasını nasıl kullandığına dikkat et... hata yapma: Hidroponik doğanın kendisi kadar güzel ve ölümcüldür - Imogen, Eğitimdeki Silah Satıcısı" },
	["hy_bamboo_jungle_ink"] = { name = "Bambu Baskısı", desc = "Fırça ile boyanmış bambu hidrografisi ile boyanmıştır.\n\nBuraya ateş etme esprisi ekleyin" },
	["hy_bamboo_jungle_black"] = { name = "Bambu Gölgesi", desc = "Fırça ile boyanmış bambu hidrografisi ile boyanmıştır.\n\nKotaro oğlunu bu silah ile kaybetti... ve bir gün o silahı kullanarak sorumlu olan adamı onunla durduracak" },
	["hy_bamboo_jungle"] = { name = "Bambu Ormanı", desc = "Fırça ile boyanmış bambu hidrografisi ile boyanmıştır.\n\nBen yinede onda bir panda olmalı diye düşünüyorum - Booth, Silah Satıcısı" },
	["am_geometric_steps"] = { name = "Akua Teras", desc = "Metalik boyalar ile geometrik bir motifte boyanmıştır.\n\nŞimdi huzur..." },
	["hy_geometric_steps"] = { name = "Geo Adımlar", desc = "Geometrik bir motif ile birlikte hidrografiyle boyanmıştır." },
	["hy_geometric_steps_green"] = { name = "Anti Teras", desc = "Geometrik bir motif hidrografisi ile boyanmıştır.\n\nHey Sabri, bunu sen almalısın... bu da senin gibi gürültülü - Carmen Cocinero, Rehine Uzmanı" },
	["hy_geometric_steps_yellow"] = { name = "Teras", desc = "Geometrik bir motif hidrografisi ile boyanmıştır.\n\nÇok güveniyorsun Valeria... bu senin ölümüne sebep olacak - Franz Kriegeld, Anka Taktisyeni" },
	["hy_kimono_diamonds"] = { name = "Neon Kimono", desc = "Geometrik bir motif hidrografisi ile boyanmıştır.\n\nSenden çok şey istediğimin farkındayım... Turner senin oğlun gibiydi - Şövalye ve Öğretmen Bölüm 1" },
	["hy_kimono_diamonds_orange"] = { name = "Turuncu Kimono", desc = "Geometrik bir motif hidrografisi ile boyanmıştır.\n\nGelenek güçlü bir şeydir" },
	["hy_kimono_diamonds_red"] = { name = "Kızıl Kimono", desc = "Geometrik bir motif hidrografisi ile boyanmıştır.\n\nTurner, her insan kırılır... olay sadece doğru basınç noktasını bulmakta - Hain ve Doğrucu Bölüm 2" },
	["sp_kimono_diamonds"] = { name = "Nane Kimono", desc = "Geometrik bir motif ile sprey boya ile boyanmıştır.\n\nHadi Booth, neler üzerinde çalıştığımı sana göstermeme izin ver - Yukako, Silah Ustası" },
	["am_seastorm"] = { name = "Gece Yarısı Fırtınası", desc = "Metalik mavi ana katmanının üstünde fırtınalı bir deniz hidrografisi ile boyanmıştır.\n\nSenden nefret etmiyorum Sebastien... Sana acıyorum - Chase Turner, Eski Koalisyon Ajanı" },
	["am_seastorm_blood"] = { name = "Gün Batımı Fırtınası 壱", desc = "Metalik kırmızı ana katman üzerine fırtınalı bir deniz hidrografisi ile boyanmıştır.\n\nAynısı olduğunu düşünüyorsun, fakat yeniden bak... bütün farkı incelik yaratır" },
	["am_seastorm_shojo"] = { name = "Gün Batımı Fırtınası 弐", desc = "am_seastorm_shojo" },
	["am_kimono_sunrise"] = { name = "Şafak", desc = "Metalik renkler kullanılarak bir gün doğumu resmedilmiştir.\n\nGüneş haklı ve haksıza farksız doğar" },
