	["bloodhound_metallic"] = { name = "Bronzlaştırılmış", desc = "Deri, silah metali ve bronz renklerinde boyandı.\n\nKan Tazısı Operasyonu, düzenbaz keskin nişancı Chase Turner'ın sonunu getirdi" },
	["bloodhound_guerrilla"] = { name = "Gerilla", desc = "Kahverengi ve sentetik derinin karışımı üzerine kamuflaj deseni eklenerek yapıld.\n\nValeria intikamını planlıyor, buna şüphe yok... - Sebastien Hennequet, Keskin Nişancı" },
	["handwrap_leathery"] = { name = "Deri", desc = "Deri, gazlı bez ve çılgın niyet ile yapılmıştır.\n\nKötü şöhretli ol" },
	["handwrap_camo_grey"] = { name = "Çam DDPAT", desc = "Sargının dışındaki kumaşa gri dijital kamuflaj deseni eklendi.\n\nBazı insanlar çok sert olduklarını söylerken... diğerleri bunu sergiliyor" },
	["handwrap_red_slaughter"] = { name = "Katliam", desc = "Kırmızıya boyanmış bu sargılar, kumaşın nerede bitip kanın nerede başladığını anlamıy güçleştiriyor.\n\nKim elleriyle çalışmayı sevmez ki?" },
	["handwrap_fabric_orange_camo"] = { name = "Çorak Arazi", desc = "Bu kendin yap el koruması geri dönüştürülmüş materyallerden yapılma.\n\nFelix, Koalisyon Kuvvetlerinin izinsiz boks ligini görmezden geliyor" },
	["slick_black"] = { name = "Gümüş Örgü", desc = "Gece yarısı mavisi süeti, eldivenlere sonsuz bir görüntü vermek maksadıyla simisyah deriyle birlikte dokundu.\n\nKanı elinizden uzak tutar... mecazi olarak" },
	["slick_military"] = { name = "Konvoy", desc = "Kahverengi yumuşak deri ve boyalı süet karışımıyla yapıldı.\n\nBazen incelik gerekir" },
	["slick_red"] = { name = "Kızıl Örgü", desc = "Siyah süet, bu eldivenlere sonsuz bir görüntü vermek maksadıyla kırmızı deri ile birlikte dikildi.\n\nİzinizi bırakın, parmak izlerinizi değil" },
	["slick_snakeskin_yellow"] = { name = "Çıngıraklı Yılan", desc = "Ten rengi, siyah deri ve yılan derisinin karışımıyla oluşturuldu.\n\nAptallar için standart dağıtım... - Imogen, Eğitimde Silah Tüccarı" },
	["sporty_green"] = { name = "Labirent", desc = "Yeşil ve beyaz eldivenler Icarus Athletics tarafından yapıldı.\n\nSadece korkaklar güneşe yakın uçmaktan korkarlar" },
	["sporty_purple"] = { name = "Pandora'nın Kutusu", desc = "Siyah ve mor eldivenlerin avuç içlerine çok göze batmayan bir baskı işlenmiştir.\n\nTerli avuçlara sahip her imha uzmanının sahip olması gereken eldivenler" },
	["sporty_light_blue"] = { name = "Süper İletken", desc = "Mavi ve siyah eldivenler, harika olmak isteyenler için birebirdir.\n\nBir tane bile istemiyorlar" },
	["sporty_military"] = { name = "Kurak", desc = "Kahverenginin birçok tonu ve göze çarpmayan kamuflaj baskısı bu eldivenlere ayrı bir görünüm katıyor.\n\nEğer kahraman olacaksak, bir kahraman gibi de görünmemizde bir sakınca yok... - Rona Sabri, Yükselen Yıldız" },
	["specialist_ddpat_green_camo"] = { name = "Orman DDPAT", desc = "Üzerine DDPAT baskılanmış pürüzlü bir kumaşla birlikte elde dikilmiş deri.\n\nBazı insanlar ellerini kirletmeyi sevmezler" },
	["specialist_kimono_diamonds_red"] = { name = "Kızıl Kimono", desc = "Bu siyah eldivenler sade bir kırmızı elmas baskısıyla vurgulanmıştır.\n\nKırmızı görmeye başla" },
