	["cu_MAG7_Tribal"] = { name = "Mağara Sanatı", desc = "Bir taş oyması görünümü vermek için özel olarak boyanmıştır.\n\nÇatışma, ilk mağara adamı nasıl yerden taş aldığını öğrendiğinden beri vardır - Booth, Silah Satıcısı" },
