	["am_czv2_mf"] = { name = "Polimer", desc = "Sürgüye polimer formülüne benzer bir çıkartma yapıldı.\n\nArtık muhattabınız Anka değil, biz kendi adamlarımıza nasıl bakacağımızı biliriz... - Kız Evlat ve Paladin 2. Kısım" },
	["aq_glock_dark-fall"] = { name = "Demir İşçiliği", desc = "Isırgan otu ve dikenleri temsil etmesi için sürgü lazerle işlendi.\n\nMüdahale edilmediğinde her bahçe birbirlerine dolanmış otlarla kaplanır" },
